import React from 'react';
import ReactDOM  from 'react-dom';
import {Route} from 'react-router'
import './App.css';
import Header from './Header';

function App() {
  return (
    <dev>
      <Header/>
      <switch>
        <Route path="/vlog" component="Vlog"></Route>
        <Route path="/blog" component="Blog"></Route>
      </switch>
    </dev>
  );
}

export default App;
